import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Dashboard from "./components/Dashboard"; // Update the import path

// Placeholder components for other pages
const ManageHome = () => <div className="p-6">Manage Home Page</div>;
const ManageAdmin = () => <div className="p-6">Manage Admin Page</div>;
const ManageAbout = () => <div className="p-6">Manage About Page</div>;
const ManagePortfolio = () => <div className="p-6">Manage Portfolio Page</div>;
const ManagePlaces = () => <div className="p-6">Manage Places Page</div>;
const ManagePackages = () => <div className="p-6">Manage Packages Page</div>;
const ManageContact = () => <div className="p-6">Manage Contact Page</div>;
const ManageSubscriber = () => <div className="p-6">Manage Subscriber Page</div>;
const ManageFooter = () => <div className="p-6">Manage Footer Page</div>;

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Route for the Dashboard */}
        <Route path="/" element={<Dashboard />} />

        {/* Other routes for managing pages */}
        <Route path="/manage-home" element={<ManageHome />} />
        <Route path="/manage-admin" element={<ManageAdmin />} />
        <Route path="/manage-about" element={<ManageAbout />} />
        <Route path="/manage-portfolio" element={<ManagePortfolio />} />
        <Route path="/manage-places" element={<ManagePlaces />} />
        <Route path="/manage-packages" element={<ManagePackages />} />
        <Route path="/manage-contact" element={<ManageContact />} />
        <Route path="/manage-subscriber" element={<ManageSubscriber />} />
        <Route path="/manage-footer" element={<ManageFooter />} />
      </Routes>
    </Router>
  );
};

export default App;
